import React, { useState } from 'react';
import BuildingList from './components/BuildingList';
import BuildingForm from './components/BuildingForm';

const App: React.FC = () => {
  const [refresh, setRefresh] = useState(false);

  const handleBuildingAdded = () => {
    setRefresh(!refresh);  // Toggle refresh to reload the building list
  };

  return (
    <div>
      <h1>Building Control System</h1>
      <BuildingForm onBuildingAdded={handleBuildingAdded} />
      {refresh ? <BuildingList /> : <BuildingList />}
    </div>
  );
};

export default App;
